import React, { useState, useEffect, useRef } from 'react';
import './Community.css';

// Sample data
const initialMoodWall = [
  {
    id: 1, 
    userName: "MindfulExplorer", 
    text: "Just completed my first mindfulness meditation. Feeling incredible peace and clarity! 🌿", 
    likes: 284,
    comments: 42,
    shares: 18,
    mood: "peaceful",
    timestamp: "2 minutes ago",
    userLevel: 27,
    userBadges: ["Meditation Expert", "Wellness Champion"],
    verified: true,
    liked: false
  },
  {
    id: 2, 
    userName: "CalmGuide", 
    text: "Our mindfulness group just had an amazing session. The positive energy was palpable! ✨", 
    likes: 567,
    comments: 89,
    shares: 34,
    mood: "calm",
    timestamp: "15 minutes ago",
    userLevel: 42,
    userBadges: ["Mindfulness Teacher", "Group Leader"],
    verified: true,
    liked: false
  }
];

const initialGroups = [
  {
    id: 1, 
    name: "Positive Mindset Collective", 
    description: "Focus on developing positive thinking patterns and emotional resilience.", 
    members: 1245, 
    isMember: false,
    engagementLevel: 87,
    activity: "high",
    tags: ["positivity", "resilience", "growth"],
    messages: [
      { id: 1, user: "GroupAdmin", text: "Welcome to our community! Feel free to introduce yourself.", time: "10:30 AM" },
      { id: 2, user: "SerenitySeeker", text: "Hello everyone! I'm excited to join this group.", time: "10:45 AM" },
      { id: 3, user: "MindfulUser", text: "Does anyone have tips for maintaining positivity during stressful times?", time: "11:20 AM" }
    ]
  },
  {
    id: 2, 
    name: "Anxiety Support Network", 
    description: "Support and techniques for managing anxiety and stress in daily life.", 
    members: 2312, 
    isMember: true,
    engagementLevel: 92,
    activity: "very high",
    tags: ["support", "anxiety-help", "calm"],
    messages: [
      { id: 1, user: "SupportGuide", text: "Remember to breathe deeply when feeling anxious. It helps!", time: "9:15 AM" },
      { id: 2, user: "CalmSoul", text: "I find that journaling really helps me process my thoughts.", time: "10:30 AM" },
      { id: 3, user: "PeacefulMind", text: "Has anyone tried the 5-4-3-2-1 grounding technique? It works wonders for me.", time: "11:05 AM" }
    ]
  }
];

const initialLiveEvents = [
  {
    id: 1,
    title: "Guided Group Meditation",
    host: "Teacher Emma",
    participants: 1247,
    startTime: "30 minutes",
    duration: "45 min",
    energyLevel: "calm"
  },
  {
    id: 2,
    title: "Stress Management Workshop",
    host: "Dr. James",
    participants: 587,
    startTime: "2 hours",
    duration: "1 hour",
    energyLevel: "informative"
  }
];

const initialChallenges = [
  {
    id: 1, 
    title: "7-Day Mindfulness Challenge", 
    description: "Develop a consistent mindfulness practice with daily guided sessions.", 
    reward: "Mindfulness Badge + 300 points",
    participants: 3421,
    duration: "7 days",
    difficulty: "intermediate"
  },
  {
    id: 2, 
    title: "Gratitude Practice Challenge", 
    description: "Cultivate gratitude through daily reflection and journaling exercises.", 
    reward: "Gratitude Badge + 200 points",
    participants: 2897,
    duration: "5 days",
    difficulty: "beginner"
  }
];

function Community({ user }) {
  const [moodWall, setMoodWall] = useState(initialMoodWall);
  const [groups, setGroups] = useState(initialGroups);
  const [activeTab, setActiveTab] = useState('feed');
  const [selectedGroup, setSelectedGroup] = useState(null);
  const [newPostText, setNewPostText] = useState('');
  const [isCreatingPost, setIsCreatingPost] = useState(false);
  const [newMessage, setNewMessage] = useState('');
  const messagesEndRef = useRef(null);

  // Scroll to bottom of chat
  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    scrollToBottom();
  }, [selectedGroup?.messages]);

  const handleAddPost = () => {
    if (newPostText.trim() !== "") {
      const newPost = {
        id: Date.now(),
        userName: user?.username || "Anonymous",
        text: newPostText,
        likes: 0,
        comments: 0,
        shares: 0,
        mood: "neutral",
        timestamp: "Just now",
        userLevel: user?.level || 1,
        userBadges: user?.badges || ["New Member"],
        verified: user?.verified || false,
        liked: false
      };
      setMoodWall(prev => [newPost, ...prev]);
      setNewPostText('');
      setIsCreatingPost(false);
    }
  };

  const handleJoinGroup = (groupId) => {
    setGroups(prevGroups => 
      prevGroups.map(group => 
        group.id === groupId ? { 
          ...group, 
          isMember: !group.isMember, 
          members: group.isMember ? group.members - 1 : group.members + 1 
        } : group
      )
    );
  };

  const handleLikePost = (postId) => {
    setMoodWall(prev => 
      prev.map(post => 
        post.id === postId ? { 
          ...post, 
          likes: post.liked ? post.likes - 1 : post.likes + 1,
          liked: !post.liked
        } : post
      )
    );
  };

  const handleCommentPost = (postId) => {
    setMoodWall(prev => 
      prev.map(post => 
        post.id === postId ? { ...post, comments: post.comments + 1 } : post
      )
    );
  };

  const handleSharePost = (postId) => {
    setMoodWall(prev => 
      prev.map(post => 
        post.id === postId ? { ...post, shares: post.shares + 1 } : post
      )
    );
    alert("Post shared successfully!");
  };

  const handleSendMessage = () => {
    if (newMessage.trim() !== "" && selectedGroup) {
      const updatedGroups = groups.map(group => {
        if (group.id === selectedGroup.id) {
          return {
            ...group,
            messages: [
              ...group.messages,
              {
                id: group.messages.length + 1,
                user: user?.username || "You",
                text: newMessage,
                time: new Date().toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })
              }
            ]
          };
        }
        return group;
      });
      
      setGroups(updatedGroups);
      setSelectedGroup(updatedGroups.find(g => g.id === selectedGroup.id));
      setNewMessage('');
    }
  };

  const renderEngagementIndicator = (level) => {
    return (
      <div className="engagement-indicator">
        <div className="engagement-bar">
          <div className="engagement-fill" style={{ width: `${level}%` }}></div>
        </div>
        <span className="engagement-value">{level}%</span>
      </div>
    );
  };

  const renderActivityLevel = (level) => {
    const levels = {
      "very high": { color: "#10B981", label: "Very Active" },
      "high": { color: "#84CC16", label: "Active" },
      "medium": { color: "#F59E0B", label: "Moderate" },
      "low": { color: "#EF4444", label: "Low" }
    };
    
    return (
      <span className="activity-level" style={{ color: levels[level]?.color }}>
        ● {levels[level]?.label}
      </span>
    );
  };

  return (
    <div className="community-hub">
      <div className="community-header">
        <h2>
          <span className="main-title">Mindful Community</span>
          <span className="subtitle">Connect, Share, and Grow Together</span>
        </h2>
        <div className="community-controls">
          <div className="view-toggles">
            <button className={`view-toggle ${activeTab === 'feed' ? 'active' : ''}`} 
                    onClick={() => setActiveTab('feed')}>
              <span className="toggle-icon">💬</span> Community Feed
            </button>
            <button className={`view-toggle ${activeTab === 'groups' ? 'active' : ''}`} 
                    onClick={() => setActiveTab('groups')}>
              <span className="toggle-icon">👥</span> Support Groups
            </button>
            <button className={`view-toggle ${activeTab === 'events' ? 'active' : ''}`} 
                    onClick={() => setActiveTab('events')}>
              <span className="toggle-icon">📅</span> Live Events
            </button>
          </div>
        </div>
      </div>

      <div className="community-layout">
        <div className="main-content">
          {activeTab === 'feed' && (
            <div className="mood-wall-section">
              <div className="section-header">
                <h3>Community Feed</h3>
                <div className="global-stats">
                  <div className="stat">
                    <span className="stat-value">2.4K</span>
                    <span className="stat-label">Active Users</span>
                  </div>
                  <div className="stat">
                    <span className="stat-value">87%</span>
                    <span className="stat-label">Positive Engagement</span>
                  </div>
                </div>
              </div>
              
              <div className="create-post-card">
                <div className="user-avatar">
                  {user?.username?.charAt(0) || "A"}
                </div>
                <div className="post-input">
                  <textarea 
                    placeholder="Share your thoughts with the community..." 
                    value={newPostText}
                    onChange={(e) => setNewPostText(e.target.value)}
                    onFocus={() => setIsCreatingPost(true)}
                  ></textarea>
                  {isCreatingPost && (
                    <div className="post-options">
                      <div className="mood-selector">
                        <span>How are you feeling?</span>
                        <div className="mood-options">
                          {["peaceful", "happy", "calm", "neutral", "anxious", "sad"].map(mood => (
                            <button key={mood} className="mood-option">{mood}</button>
                          ))}
                        </div>
                      </div>
                      <div className="post-actions">
                        <button className="cancel-btn" onClick={() => {
                          setIsCreatingPost(false);
                          setNewPostText('');
                        }}>Cancel</button>
                        <button className="share-btn" onClick={handleAddPost}>Share</button>
                      </div>
                    </div>
                  )}
                </div>
              </div>
              
              <div className="post-list">
                {moodWall.map(post => (
                  <div key={post.id} className="post-card">
                    <div className="post-header">
                      <div className="user-info">
                        <div className="post-avatar">{post.userName.charAt(0)}</div>
                        <div className="user-details">
                          <div className="username-row">
                            <span className="post-username">{post.userName}</span>
                            {post.verified && <span className="verified-badge">✓</span>}
                            <span className="user-level">Level {post.userLevel}</span>
                          </div>
                          <span className="post-timestamp">{post.timestamp}</span>
                        </div>
                      </div>
                      <div className="post-mood">
                        <span className={`mood-indicator ${post.mood}`}></span>
                        {post.mood}
                      </div>
                    </div>
                    <p className="post-content">{post.text}</p>
                    <div className="post-badges">
                      {post.userBadges.map((badge, index) => (
                        <span key={index} className="badge">{badge}</span>
                      ))}
                    </div>
                    <div className="post-actions">
                      <button 
                        className={`action-btn like ${post.liked ? 'active' : ''}`} 
                        onClick={() => handleLikePost(post.id)}
                      >
                        <span className="icon">👍</span> Like ({post.likes})
                      </button>
                      <button 
                        className="action-btn comment" 
                        onClick={() => handleCommentPost(post.id)}
                      >
                        <span className="icon">💬</span> Comment ({post.comments})
                      </button>
                      <button 
                        className="action-btn share" 
                        onClick={() => handleSharePost(post.id)}
                      >
                        <span className="icon">↗️</span> Share ({post.shares})
                      </button>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}
          
          {activeTab === 'groups' && !selectedGroup && (
            <div className="groups-grid">
              <h3>Support Groups</h3>
              <div className="groups-container">
                {groups.map(group => (
                  <div key={group.id} className={`group-card ${group.isMember ? 'joined' : ''}`}>
                    <div className="group-header">
                      <h4>{group.name}</h4>
                      {renderEngagementIndicator(group.engagementLevel)}
                    </div>
                    <p className="group-description">{group.description}</p>
                    <div className="group-meta">
                      <div className="group-stats">
                        <span className="members-count">👥 {group.members.toLocaleString()} members</span>
                        {renderActivityLevel(group.activity)}
                      </div>
                      <div className="group-tags">
                        {group.tags.map(tag => (
                          <span key={tag} className="tag">#{tag}</span>
                        ))}
                      </div>
                    </div>
                    <div className="group-footer">
                      <button 
                        className={`join-btn ${group.isMember ? 'joined' : ''}`}
                        onClick={() => handleJoinGroup(group.id)}
                      >
                        {group.isMember ? 'Joined' : 'Join Group'}
                      </button>
                      <button 
                        className="explore-btn"
                        onClick={() => setSelectedGroup(group)}
                      >
                        {group.isMember ? 'Enter Chat' : 'View Group'}
                      </button>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}

          {activeTab === 'groups' && selectedGroup && (
            <div className="group-chat-container">
              <div className="chat-header">
                <button className="back-button" onClick={() => setSelectedGroup(null)}>
                  ← Back
                </button>
                <h3>{selectedGroup.name}</h3>
                <div className="member-count">
                  {selectedGroup.members} members
                </div>
              </div>
              
              <div className="chat-messages">
                {selectedGroup.messages.map(message => (
                  <div 
                    key={message.id} 
                    className={`message ${message.user === (user?.username || "You") ? 'own-message' : ''}`}
                  >
                    <div className="message-header">
                      <span className="message-user">{message.user}</span>
                      <span className="message-time">{message.time}</span>
                    </div>
                    <div className="message-content">{message.text}</div>
                  </div>
                ))}
                <div ref={messagesEndRef} />
              </div>
              
              <div className="chat-input-container">
                <input
                  type="text"
                  placeholder="Type your message here..."
                  value={newMessage}
                  onChange={(e) => setNewMessage(e.target.value)}
                  onKeyPress={(e) => e.key === 'Enter' && handleSendMessage()}
                  className="chat-input"
                />
                <button 
                  className="send-button"
                  onClick={handleSendMessage}
                  disabled={!newMessage.trim()}
                >
                  Send
                </button>
              </div>
            </div>
          )}

          {activeTab === 'events' && (
            <div className="events-section">
              <h3>Live Events & Workshops</h3>
              <div className="events-container">
                {initialLiveEvents.map(event => (
                  <div key={event.id} className="event-card">
                    <div className="event-header">
                      <h4>{event.title}</h4>
                      <div className="event-status live">LIVE</div>
                    </div>
                    <div className="event-details">
                      <div className="event-host">
                        <span className="label">Host:</span>
                        <span className="value">{event.host}</span>
                      </div>
                      <div className="event-participants">
                        <span className="label">Participants:</span>
                        <span className="value">{event.participants.toLocaleString()}</span>
                      </div>
                      <div className="event-time">
                        <span className="label">Starts in:</span>
                        <span className="value">{event.startTime}</span>
                      </div>
                      <div className="event-energy">
                        <span className="label">Vibe:</span>
                        <span className="value">{event.energyLevel}</span>
                      </div>
                    </div>
                    <div className="event-actions">
                      <button className="join-event-btn">Join Event</button>
                      <button className="remind-btn">Set Reminder</button>
                    </div>
                  </div>
                ))}
              </div>
              
              <div className="challenges-section">
                <h3>Wellness Challenges</h3>
                <div className="challenges-container">
                  {initialChallenges.map(challenge => (
                    <div key={challenge.id} className="challenge-card">
                      <div className="challenge-header">
                        <h4>{challenge.title}</h4>
                        <div className={`difficulty-badge ${challenge.difficulty}`}>{challenge.difficulty}</div>
                      </div>
                      <p className="challenge-description">{challenge.description}</p>
                      <div className="challenge-meta">
                        <div className="participants">
                          <span className="icon">👥</span> 
                          {challenge.participants.toLocaleString()} participating
                        </div>
                        <div className="duration">
                          <span className="icon">⏱</span> 
                          {challenge.duration}
                        </div>
                      </div>
                      <div className="challenge-reward">{challenge.reward}</div>
                      <button className="join-challenge-btn">Join Challenge</button>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}
        </div>
        
        <div className="community-sidebar">
          <div className="sidebar-card">
            <h3>Trending Topics</h3>
            <div className="trending-list">
              <div className="trending-item">
                <span className="trending-rank">1</span>
                <div className="trending-info">
                  <span className="trending-tag">#MindfulLiving</span>
                  <span className="trending-count">2.4K posts</span>
                </div>
              </div>
              <div className="trending-item">
                <span className="trending-rank">2</span>
                <div className="trending-info">
                  <span className="trending-tag">#SelfCare</span>
                  <span className="trending-count">1.8K posts</span>
                </div>
              </div>
              <div className="trending-item">
                <span className="trending-rank">3</span>
                <div className="trending-info">
                  <span className="trending-tag">#MentalHealthAwareness</span>
                  <span className="trending-count">1.5K posts</span>
                </div>
              </div>
            </div>
          </div>
          
          <div className="sidebar-card">
            <h3>Suggested Connections</h3>
            <div className="connections-list">
              <div className="connection">
                <div className="connection-avatar">M</div>
                <div className="connection-info">
                  <span className="connection-name">MindfulExplorer</span>
                  <span className="connection-level">Level 32</span>
                </div>
                <button className="connect-btn">Connect</button>
              </div>
              <div className="connection">
                <div className="connection-avatar">S</div>
                <div className="connection-info">
                  <span className="connection-name">SerenitySeeker</span>
                  <span className="connection-level">Level 45</span>
                </div>
                <button className="connect-btn">Connect</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Community;
